</code></pre>
https:&#x2F;&#x2F;imgur.com&#x2F;a&#x2F;US0klgu<p>This is the behaviour I&#x27;m getting with and without position:static. But I fail to understand why? All information that I&#x27;ve about position:static is that it doesn&#x27;t accept Top,Bottom,Left,Right values.<p>My teacher say &quot;it is floating without static...normal flow of document&quot; but I don&#x27;t get it.
